import React from "react";
import '../CSS/Sidebar.css'
import User from '../images/user.png'
import Edit from '../images/edit.png'
import Home from '../images/home.png'
import Submit from '../images/submit.png'
import Logout from '../images/signout.png'
import { useNavigate } from "react-router-dom";


function Sidebar() {
    const redirect = useNavigate()

    const handleClick = (e) => {
        e.preventDefault();
        redirect('/login')
    }


    return (
        <div className="side_nav">
            <div className="user">
                <img src={User} alt="P" className="user_img" />
                <div>
                    <h2>Abdiaziz</h2>
                    <p>joined 2023</p>
                </div>
            </div>
            <ul>
                <li onClick={handleClick}><img src={Home} alt="" /><p>Home</p></li>
                <li><img src={Submit} alt="" /><p>Submit</p></li>
                <li><img src={Edit} alt="" /><p>Previous</p></li>
            </ul>

            <ul>
                <li className="pos"><img src={Logout} alt="" /><p>Logout</p></li>
            </ul>
        </div>
    )
}

export default Sidebar;
